import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <Subscriber />
    </div>
  );
};

const Subscriber = () => {
  return (
    <div className="subscriber">
      <input id="email" type="email" name="email" />
      <input type="button" value="SUBSCRIBE" />
    </div>
  );
};

const Social = () => {
  return <div className="social"></div>;
};
export default Footer;
